import React from 'react';
import styles from '../header/header.module.css'
class Header extends React.Component {



    render () {

        var Logo = () => {
            return (
                <a><img src="imgs/18-years.png" className={styles.logo}></img></a>
            );
        }

        var LeftSideTopNav = () => {
            return ( 
            <div className="col-3">
                <div className={styles.LogoWrapper}>
                    <Logo/>
                </div>
            </div>
            );
        }

        var RightSideTopNav = () => {
            return (
            <div className="col-9" >
                <div className={styles.navRightSide}>       
                    <div >content</div>
                </div>
            </div>
            );
        }



        return (
            <div className={styles.headerOuter}>
                <div className="container">
                    <div className="row">
                            <LeftSideTopNav/>
                            <RightSideTopNav/>
                    </div>
                </div>
            </div>
        );
    }
}

export default Header;
